INSERT INTO `tb_vagas` (`id`, `titulo`, `descricao`, `tipo_contrato`, `local`, `salario`, `requisitos`, `beneficios`, `fechamento_vaga`, `created_at`, `updated_at`, `modelo_vaga`, `deleted_at`) VALUES
(1, 'Desenvolvedor php senior', 'O mundo é ágil e nos cobra agilidade!\n\nAcreditamos que a inovação é, antes de tudo, uma atitude. Decidir, surpreender, testar e implantar novas realidades e redefinir o futuro. Queremos criar ideias que transformem pessoas e, assim, impulsionar as pessoas a transformar o mundo.\n\nComo conquistamos esta transformação...\n\nProvocando a mudança da mentalidade de nossas pessoas - buscando empreendedorismo, resiliência, compreensão da proposta de valor Qintess e vivência no dia a dia.\n\nEstamos à procura de um Desenvolvedor PHP Sênior!', 'clt', 'São Paulo, São Paulo, Brasil', 9000.00, 'Superior ou pós graduação em TI completo com apresentação do diploma;\n\nConhecimentos em PHP, Java 8, JSF, primefaces 6.2, lombok, Springframework, jasperreport.\n\nBenefícios', 'Vale Refeição/Alimentação Alelo;\n\nAssistência Médica Notre Dame Intermédica | Hapvida - mensalidade 100% coberta para o colaborador e 50% para dependentes e assistência coparticipativa;\n\nAssistência odontológica Amil: mensalidade 100% coberto para o colaborador e 50% para dependentes;\n\nSeguro de Vida: 100% custeado pela empresa;\n\nLicença maternidade e paternidade estendida;\n\nParcerias com Instituições de Ensino Superior e Escolas de Idiomas que oferecem desconto (para o colaborador e dependentes diretos);\n\nConvênio com Farmácias, Droga Raia e Drogasil com desconto em medicamentos (Univers - App);\n\nApoio a Certificações (de acordo com a área de atuação);\n\nGympass | Wellhub;\n\nNotebook fornecido pela Empresa;\n\nBônus por indicação de profissionais;\n\nPrograma de Realocação Interna.', NULL, '2025-06-03 15:35:57', '2025-06-05 16:21:05', NULL, NULL),
(9, 'dasdasd', '312312', 'pj', '112312', 9000.00, 'daksjdaks', 'kdjkasjd', NULL, '2025-06-03 16:02:30', '2025-06-05 15:52:42', NULL, '2025-06-05 16:11:07'),
(10, 'Pessoa Desenvolvedora Back End JAVA SR (SP)', 'Que tal ter a chance de atuar como Pessoa Desenvolvedora Backend SR JAVA, dentro de um ambiente que valoriza espírito empreendedor, autonomia, agilidade, foco no cliente, excelência e visão de longo prazo e inconformismo, numa área tecnologia do Consumer Banking, que tem como objetivo construir e evoluir funcionalidades, no ramo bancário de varejo. Você poderá trabalhar e aprender sobre Cartões de Crédito, Meios de Pagamentos, Conta Corrente, Onboarding, Produtos de Financiamentos, Crédito, Seguros, Open Finance entre outras frentes.\nIrá participar de todas as fases do desenvolvimento de um novo produto, desde o design, codificação até a entrega em produção e seu posterior acompanhamento.\n\n\nOnde? Presencial 4x em São Paulo, região Central ou Faria Lima, 1x remoto na semana. \n\nHorário: 10:00 as 19:00 Segunda a Sexta-feira\nAtividades:\n\n• Atuar junto à equipe de Desenvolvimento.\n• Trabalhar com arquitetura orientada a microsserviços e modelo Devops.\n• Expandir o pipeline de produtos.\n• Atuar nos projetos que consistem em aumentar e flexibilizar o negócio.\n• Monitoramento e performance de sistemas', 'CLT/PJ', 'São Paulo, São Paulo, Brasil', 2000.00, 'Soft skills:\n\n• Boa capacidade de comunicação, facilidade de concentração, relacionamento e trabalho em grupo;\n• Paixão em aprender novas habilidades capazes de impulsionar novos modelos de negócios;\n• Capacidade de aprender rapidamente novas linguagens e tecnologias. Acreditamos em usar a melhor ferramenta para resolver cada problema e o aprendizado contínuo não deve ser um empecilho;\n\n\nFormação: Formação superior completa em engenharia, ciências da computação ou áreas relacionadas', 'Benefícios e Incentivos\n\nSaúde e Bem-estar: Assistências Médica e Odontológica (SulAmérica), Seguro de Vida (Prudential), Previdência Privada (Onze) e acesso ao WellHub para cuidar da mente e do corpo, além de VR Caju.\n\nDesenvolvimento: Coparticipação na assinatura do Alura, ajuda para cursos de inglês, Ciclo de Avaliação de Desempenho com Plano de Desenvolvimento Individual (PDI), e programas internos de mentoria e capacitação profissional.\n\nEquilíbrio: Com nosso benefício de Antecipação de Férias, quem tem entre 6 e 12 meses de contrato pode aproveitar o descanso sem perder esse direito ao mudar de emprego.\n\nDiversidade e Inclusão: Todas as nossas oportunidades são elegíveis para pessoas com deficiência.\n\nSobre a Elumini\n\nSomos uma consultoria sólida no mercado de TI, com operações na América do Sul, América do Norte e Europa. Certificada pelo Great Place to Work®, somos reconhecidos por nossa forma única de valorizar profissionais e promover um ambiente diferenciado.\n\nCandidate-se e decole sua carreira! Venha ser um(a) Eluminer! estou editando', '2025-06-05', '2025-06-03 19:39:47', '2025-06-05 18:38:22', 'hibrido', NULL),
(11, 'Estagiário de Software em Processamento de Fala', '23423', 'pj', '23423423', 23423.00, 'kjsadj', 'asdjajh', NULL, '2025-06-03 19:44:38', NULL, NULL, NULL),
(17, 'Estagiário de Software em Processamento de Fala', 'Que tal ter a chance de atuar como Pessoa Desenvolvedora Backend SR JAVA, dentro de um ambiente que valoriza espírito empreendedor, autonomia, agilidade, foco no cliente, excelência e visão de longo prazo e inconformismo, numa área tecnologia do Consumer Banking, que tem como objetivo construir e evoluir funcionalidades, no ramo bancário de varejo. Você poderá trabalhar e aprender sobre Cartões de Crédito, Meios de Pagamentos, Conta Corrente, Onboarding, Produtos de Financiamentos, Crédito, Seguros, Open Finance entre outras frentes.\nIrá participar de todas as fases do desenvolvimento de um novo produto, desde o design, codificação até a entrega em produção e seu posterior acompanhamento.\n\nOnde? Presencial 4x em São Paulo, região Central ou Faria Lima, 1x remoto na semana. \n\nHorário: 10:00 as 19:00 Segunda a Sexta-feira\n\n• Atuar junto à equipe de Desenvolvimento.\n• Trabalhar com arquitetura orientada a microsserviços e modelo Devops.\n• Expandir o pipeline de produtos.\n• Atuar nos projetos que consistem em aumentar e flexibilizar o negócio.\n• Monitoramento e performance de sistemas', 'clt', 'São Paulo, região Central ou Faria Lima', 12312.00, 'Necessário:\n\n• Conhecimento em Java, Spring Boot, Mensageria e REST/SOAP;\n• Conhecimento desejável em Kotlin, Kubernetes, DataDog, Jenkins, Docker, Kafka e RabbitMQ\n• Conhecimento em Bancos Relacionais (PostgreeSQL) e Não Relacionais (Dynamo e MongoDB);\n• Conhecimento com a AWS cloud: EKS, SQS, SNS, S3, Secrets Manager, API Gateway, Lambda;\n• Conhecimento de Design Patterns e Clean Architecture;\n\n\nSoft skills:\n\n• Boa capacidade de comunicação, facilidade de concentração, relacionamento e trabalho em grupo;\n• Paixão em aprender novas habilidades capazes de impulsionar novos modelos de negócios;\n• Capacidade de aprender rapidamente novas linguagens e tecnologias. Acreditamos em usar a melhor ferramenta para resolver cada problema e o aprendizado contínuo não deve ser um empecilho;\n\n\nFormação: Formação superior completa em engenharia, ciências da computação ou áreas relacionadas.', 'Benefícios e Incentivos\n\nSaúde e Bem-estar: Assistências Médica e Odontológica (SulAmérica), Seguro de Vida (Prudential), Previdência Privada (Onze) e acesso ao WellHub para cuidar da mente e do corpo, além de VR Caju.\n\nDesenvolvimento: Coparticipação na assinatura do Alura, ajuda para cursos de inglês, Ciclo de Avaliação de Desempenho com Plano de Desenvolvimento Individual (PDI), e programas internos de mentoria e capacitação profissional.\n\nEquilíbrio: Com nosso benefício de Antecipação de Férias, quem tem entre 6 e 12 meses de contrato pode aproveitar o descanso sem perder esse direito ao mudar de emprego.\n\nDiversidade e Inclusão: Todas as nossas oportunidades são elegíveis para pessoas com deficiência.\n\nSobre a Elumini\n\nSomos uma consultoria sólida no mercado de TI, com operações na América do Sul, América do Norte e Europa. Certificada pelo Great Place to Work®, somos reconhecidos por nossa forma única de valorizar profissionais e promover um ambiente diferenciado.\n\nCandidate-se e decole sua carreira! Venha ser um(a) Eluminer!', NULL, '2025-06-03 21:03:19', NULL, 'presencial', NULL),
(18, 'Estagiário de Software em Processamento de Fala', 'Se você tem o espírito criativo e inovador e quer trabalhar em um dos maiores institutos de ciência e tecnologia do Brasil essa é a sua chance! Venha conhecer o SiDi, e saiba mais sobre esta oportunidade. Estamos em busca de um profissional com interesse em atuar com Processamento de Fala para integrar nosso time e nos ajudar no desenvolvimento do assistente virtual, que sejam proativos, dinâmicos, comunicativos, e que gostem de trabalho em equipe, para fazerem parte do nosso time de #SiDiers.', 'CLT/PJ', 'Campinas, São Paulo, Brasil', 8500.00, 'Participar de todo o ciclo do desenvolvimento do assistente virtual.\n\n\n\nConhecimento em programação em Bash Scripts e Python.\n\n\n\nConhecimento em engines de ASR ou Processamento de Sinais;\nConhecimento em desenvolvimento de software ou pesquisa na área de Machine Learning/Deep Learning.\n\n\nFormação Acadêmica\n\nCursando Ciência da Computação, Engenharia da Computação, Análise de Sistemas, Engenharia Elétrica ou áreas correlatas.\n\n\n\nInglês - Conversação, leitura e escrita intermediário.\nOportunidade para Campinas/SP em regime de estágio Híbrido.\n\nO que esperamos de todos os #SiDiers:\n\nAbrir a mente para o novo\n\nManter diálogo aberto e direto\n\nDesenvolver-se continuamente\n\nFazer o melhor, sempre\n\nConstruir em parceria\n\nPensar grande, fazer rápido', 'Bem-Estar: Seguro de Vida, Gympass e Ginástica Laboral;\n Saúde: Convênio Médico, Odontológico e Suporte Psicológico;\n Alimentação: Vale Refeição e Vale Alimentação;\n Transporte: Estacionamento e/ou Vale-Transporte;\n Diversidade: Comitês sobre Bem-estar, Diversidade, Saúde Mental, Social, Sustentabilidade e Inclusão das mulheres na tecnologia\n Escritórios Modernos: Ambientes descontraídos e colaborativos com espaços de convivência, copas, máquina de café e snacks, etc\n Ainda quer mais? Dezenas de parcerias com benefícios e descontos!\n\n\nPara nós, inclusão não é apenas somar mais um ao nosso time, é somar diferenças e particularidades. É justamente dessa mistura de técnicas, habilidades e histórias que nos inspiramos para fazer diferentes pontos de vista olharem para um mesmo horizonte, sempre para frente.\n\nTrabalhamos em um ambiente de oportunidades iguais, independente de gênero, orientação sexual, religião ou deficiência.\n\nTodas as nossas vagas estão disponíveis para PCDs.\n\nCÓDIGO DA VAGA: 4178 N1', NULL, '2025-06-04 19:57:45', NULL, 'presencial', NULL),
